import React, { useEffect, useState } from 'react'
import axios from 'axios'
import { Link } from 'react-router-dom'
import './ShowVecinos.css'

const endpoint = 'http://localhost:8000/api'

const ShowVecinos = () => {
    const [vecinos, setVecinos] = useState([])

    useEffect(() => {
        getAllVecinos()
    }, [])

    const getAllVecinos = async () => {
        const response = await axios.get(`${endpoint}/vecinos`)
        setVecinos(response.data);

    }
    

    return (
        <div>

            <h1>VECINOS DE LA COMUNIDAD</h1>

            <ul className="listado-grid">

                {vecinos.map((vecino) => (
                    <Link to={'/'}>
                        <div  key={vecino.id} className="card text-center bg-dark ">
                        <img src={require("./../img/2.jpg")} alt="EE"></img>
                            <div className="card-body">
                                <h4 className='card-title'>{vecino.nombre}</h4>
                                <div className="card-text ">
                                    <p> Apellido : {vecino.apellido}</p>
                                    <p> Piso : {vecino.piso}</p>
                                </div>
                            </div>
                        </div>
                    </Link>

                ))}


            </ul>
            <img src={require("./../img/descarga.jpg")} alt="EE"></img>
        </div>
    )
}

export default ShowVecinos
